import React from "react";
import { vehicles } from "../../../constants";

const Learn_Speed = (props) => {
  const { car } = props;
  const caNumebrs = vehicles.find(
    (vehicle) => vehicle.model === car.model
  ).numbers;

  return (
    <section
      className="md:px-32 padding bg-slate-950 fullSection"
      style={{ backgroundImage: "url(" + Background + ")" }}
    >
      <div className="flex-seperate">
        {caNumebrs.map((item) => {
          return (
            <div key={item.label} className="text-center">
              <h4 className="font-bold sm:text-4xl text-2xl">{item.count}</h4>
              <p className="text-slate-400 md:text-sm text-[10px]">
                {item.label}
              </p>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Learn_Speed;
